	public static long lengthOfLongestSubstring2(String s) {
        int n = s.length(), ans = 0;

        // Current index of character.
        int[] index = new int[128];

        // Attempt to extend the range.
        int i = 0;
        for (int j = 0; j < n; j++) {
        	//i = max (index[s[a], 0) 
        	System.out.println("index i: " +i + " , index j: "+j + "  ,s.chartAt(j): "+  s.charAt(j) + "   ,index[s.chartAt(j)]  " +index[s.charAt(j)]+"  ,max:  " + Math.max(index[s.charAt(j)], i));
         
        	i = Math.max(index[s.charAt(j)], i);
            ans = Math.max(ans, j - i + 1);
            System.out.println("ans:  "+ans);
            index[s.charAt(j)] = j + 1;
            System.out.println("index value:  " + index[s.charAt(j)]);
        }
        return ans;
	}
	
	
	
